import React from 'react';

import settingsGear from '../../public/settings.png';

export const Header = () => {
    return (
        <Header style={headerStyle}>
            <h1 style={logoStyle}>HonestWork</h1>
            <img src={settingsGear} alt="Settings Gear" style={settingsStyle} />
        </Header>
    )
}

const headerStyle = {
    background: '#ffffff',
    padding: '15px'
}

const logoStyle = {
    color: '#000000'
}

const settingsStyle = {
    height: '50px',
    width: '50px'
}
